<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":3313142682428018,"name":"Apache Spark on Databricks for Data Scientists (Scala)","language":"scala","commands":[{"version":"CommandV1","origId":3313142682428020,"guid":"c2075023-9da4-49c5-8875-2dc567683df8","subtype":"command","commandType":"auto","position":1.0,"command":"%md \n# Apache Spark on Databricks for Data Scientists\n\n** Welcome to Databricks! **\n\nThis notebook intended to be the second step in your process to learn more about how to best use Apache Spark and Databricks together. We'll be walking through the core concepts, the fundamental abstractions, and some machine learning tools from the perspective of as data scientist! As a data scientist you're likely querying data from a variety of sources, joining together various tables and leveraging that information to build out statistical models. Databricks and Apache Spark make this process simple by allowing you to connect to a variety of sources and work with the data in one unified environment, then deploy your work to production quickly. Additionally because Databricks and Apache Spark support multiple languages, it's straightforward to do a lot of the analysis using the languages you know and the tools that you're likely already familiar with.\n\nFirst, it's worth defining Databricks. Databricks is a managed platform for running Apache Spark - that means that you do not have to learn complex cluster management concepts nor perform tedious maintenance tasks to take advantage of Apache Spark. Databricks also provides a host of features to help its users be more productive with Spark. It���s a point and click platform for those that prefer a user interface like data scientists or data analysts. This UI is accompanied by a sophisticated API for those that want to automate jobs and aspects of their data workloads. To meet the needs of enterprises, Databricks also includes features such as role-based access control and other intelligent optimizations that not only improve usability for users but also reduce costs and complexity for administrators.\n\n** The Gentle Introduction Series **\n\nThis notebook is a part of a series of notebooks aimed to get you up to speed with the basics of Spark quickly. This notebook is best suited for those that have very little or no experience with Spark. The series also serves as a strong review for those that have some experience with Apache Spark but aren't as familiar with some of the more sophisticated tools like UDF creation and machine learning pipelines. The other notebooks in this series are:\n\n- [A Gentle Introduction to Apache Spark on Databricks](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055043/484361/latest.html)\n- [Apache Spark on Databricks for Data Scientists](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055194/484361/latest.html)\n- [Apache Spark on Databricks for Data Engineers](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055109/484361/latest.html)\n\n## Tutorial Overview\n\nThis tutorial centers around a core idea that we hope to explore:\n\n**The number of farmer's markets in a given zip code can be predicted from the income and taxes paid in a given area.**\n\nIt seems plausible that areas with higher income have more farmer's markets simply because there is more of a market for those goods. Of course there are many potential holes in this idea, but that's part of the desire to test it :). This tutorial will explore our process for discovering whether or not we can accurately predict the number of farmer's markets! *It is worth mentioning that this notebook is not intended to be a academically rigorous, but simply a good example of the work a data scientist might be performing using Apache Spark and Databricks.*\n\n## The Data\n\n![img](http://training.databricks.com/databricks_guide/USDA_logo.png)\n\nThe first of the two datasets that we will be working with is the **Farmers Markets Directory and Geographic Data**. This dataset contains information on the longitude and latitude, state, address, name, and zip code of Farmers Markets in the United States. The raw data is published by the Department of Agriculture. The version on the data that is found in Databricks (and is used in this tutorial) was updated by the Department of Agriculture on Dec 01, 2015.\n\n![img](http://training.databricks.com/databricks_guide/irs-logo.jpg)\n\nThe second we will be working with is the **SOI Tax Stats - Individual Income Tax Statistics - ZIP Code Data (SOI)**. This study provides detailed tabulations of individual income tax return data at the state and ZIP code level and is provided by the IRS. This repository only has a sample of the data: 2013 and includes \"AGI\". The ZIP Code data show selected income and tax items classified by State, ZIP Code, and size of adjusted gross income. Data are based on individual income tax returns filed with the IRS and are available for Tax Years 1998, 2001, 2004 through 2013. The data include items, such as:\n\n- Number of returns, which approximates the number of households\n- Number of personal exemptions, which approximates the population\n- Adjusted gross income\n- Wages and salaries\n- Dividends before exclusion\n- Interest received\n\nYou can learn more about the two datasets on data.gov:\n\n- [Farmer's Market Data](http://catalog.data.gov/dataset/farmers-markets-geographic-data/resource/cca1cc8a-9670-4a27-a8c7-0c0180459bef)\n- [Zip Code Data](http://catalog.data.gov/dataset/zip-code-data)\n\n### Getting the Data\n\nAs a data scientist, your data is likely going to be living in a place like S3 or Redshift. Apache Spark provides simple and easy connectors to these data sources and Databricks provides simple demonstrations of how to use them. Just search in the Databricks guide (use the `?` at the top left) to see if your data source is available. For the purposes of this tutorial, our files are already available on S3 via `dbfs` or the Databricks file system. [While you're free to upload the csvs made available on data.gov as a table](https://docs.cloud.databricks.com/docs/latest/databricks_guide/index.html#03%20Accessing%20Data/1%20Data%20Import%20UI.html) you can also (more easily) access this data via the `/databricks-datasets` directory which is a repository of public, Databricks-hosted datasets that is available on all Databricks accounts.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":1465095865432,"submitTime":1465095865432,"finishTime":1465095865433,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"6eac81bf-e756-4655-8d1a-88c6c098fae3"},{"version":"CommandV1","origId":3313142682428021,"guid":"442e8045-93ad-46a0-a8fc-2657b04107d0","subtype":"command","commandType":"auto","position":1.25,"command":"%md First things first! We've got to read in our data. This data is located in in csv files so we'll use the [spark-csv](https://github.com/databricks/spark-csv) package to do this. In Databricks, it's as simple as specifying the format of the csv file and loading it in as a DataFrame. In Apache Spark 2.0, you do not need to use the `spark-csv` package and can just read the data in directly.\n\nAs a data scientist, you've likely come across DataFrames either in R, or python and pandas. Apache Spark DataFrames do not stray too much from this ngs":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"61886ab4-7b54-4f10-be8b-5a24f9e7f336"},{"version":"CommandV1","origId":3313142682428093,"guid":"18da7fcb-9525-4234-a574-964ff271faec","subtype":"command","commandType":"auto","position":34.0,"command":"%md \n# Conclusion\n\nWe can see from the above that we realized a fairly significant link by leveraging the pipeline, a more sophisticated model, and better hyperparameter tuning. However these results are still a bit disappointing. With that being said, we're working with very few features and we've likely made some assumptions that just aren't quite valid (like the zip code shortening). Also just because a rich zipcode exists doesn't mean that the farmer's market would be held in that zip code too. In fact we might want to start looking at neighboring zip codes or doing some sort of distance measure to predict whether or not there exists a farmer's market in a certain mile radius from a wealthy zip code.\n\nWith that being said, we've got a lot of other potential features and plenty of other parameters to tune on our random forest so play around with the above pipeline and see if you can improve it further!\n\nDoing so is outside of the context of this notebook! Now go out there and start making predictions!","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":1465095865938,"submitTime":1465095865938,"finishTime":1465095865943,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":nul
